console.table('inizio',input)


let startX = 0
let startY = 0
let turn = 0


for (let i = 0; i < input.length; i++) {
    if(input[i].indexOf('^') > 0){
        startX = input[i].indexOf('^')
        startY = i
        
        input[i][startX] = '.'
    }
}

console.log('punto di inizio', startX, startY)

while(startY >= 0 && startX >= 0 && startY < input.length && startX < input[0].length){
    // console.log('X',startX)
    // console.log('Y',startY)
    if(!turn){
        input[startY][startX] = 'X'
        if(input[startY - 1][startX] === '.' || input[startY - 1][startX] === 'X'){
            startY--
            input[startY][startX] = 'X'
        } else {
            turn = 90
        }
    }
    else if(turn === 90){
        if(input[startY][startX + 1] === '.' || input[startY][startX + 1] === 'X'){
            startX++
            input[startY][startX] = 'X'
        } else{
            turn = 180
        }
    }
    else if(turn === 180){
        if(input[startY + 1][startX] === '.' || input[startY + 1][startX] === 'X'){
            startY++
            input[startY][startX] = 'X'
        } else {
            turn = 270
        }
    }
    else if(turn === 270) {
        if(input[startY][startX - 1] === '.' || input[startY][startX - 1] === 'X'){
            startX--
            input[startY][startX] = 'X'
        } else{
            turn = 0
        }
    }
    // console.table(input)

    let allBlocked = 
        (startY - 1 < 0) ||
        (startX + 1 >= input[0].length) ||
        (startY + 1 >= input.length) ||
        (startX - 1 < 0);

    if (allBlocked) {
        console.log('La guardia è bloccata. Termino il ciclo.');
        break;
    }
}
let totalX = 0
input.forEach(row =>{
    totalX += row.filter(el => el === 'X').length
})
console.table(input)

